import Navbar from "./components/Navbar";
import Login from "./components/Login"; 
import  Questions  from "./components/Questions";
import { Hamburger } from "./components/Hamburger";






function App() {
  return (
    <div>

  <Navbar />

  <Login />

    <Questions />
    <Hamburger/>

<div> <p className="heading">Dive into the thrill of knowledge with our captivating quizzes. Click to Start Now!</p>
<button className="btn">Click here to Start</button></div>

  </div>

  );
}

export default App;
